import React from 'react';

interface OutputLayerProps {
    outputShape?: number[];
    activationFunction?: string;
}

const OutputLayer: React.FC<OutputLayerProps> = ({ 
    outputShape = [10], 
    activationFunction = 'softmax' 
}) => {
    return (
        <div style={{ userSelect: 'none' }}>
            <h4 style={{ margin: 0, fontSize: 14, color: '#ffffff', userSelect: 'none' }}>Output Layer</h4>
            <div style={{ fontSize: 12, color: '#ccc', userSelect: 'none' }}>
                <div>Shape: [{outputShape.join(', ')}]</div>
                <div>Activation: {activationFunction}</div>
            </div>
        </div>
    );
};

export default OutputLayer;
